class Home extends Component {
  audio = new Audio(Alert);
  componentDidMount(){
    play.audio;

  }



  render() {

const { lat, lng } = this.props;

    return (
<div>

{lat}{"  "}{lng}

<Music url={Alert}/>
</div>

